import { Text, View } from "react-native";

const Bubble = ({text}) =>{
    return(
        <View>
            <Text style={{fontSize:20}}> ({text}</Text>
            <Text style={{fontSize:20}}> /</Text> 
        </View>
    )
}

export default Bubble;
